import React, {useState} from 'react';

const CreateServices = () => {
    const [Name, SetName] = useState()
    const [Type, SetType] = useState()
    const [Annotation, SetAnnotation] = useState()
    const [IdSuperType, SetIdSuperType] = useState()
    const [IdType, setIdType] = useState()
    const [Cost, setCost] = useState()


    const SaveService = (e) => {
        e.preventDefault()

      }

  return (
    <form>
        <div> Супер тип
            <div>Название: </div><input value={Name} onChange={e => SetName(e.target.value)}/>
            <div>Аннотация: </div><input onChange={e => SetAnnotation(e.target.value)}/>
        </div>
        <div> Тип
            <div>Название: </div><input value={Name} onChange={e => SetName(e.target.value)}/>
            <div>Аннотация: </div><input onChange={e => SetAnnotation(e.target.value)}/>
            <div>id супер типа: </div><input onChange={e => SetIdSuperType(e.target.value)}/>
        </div>
        <div> Услуга
            <div>Название: </div><input value={Name} onChange={e => SetName(e.target.value)}/>
            <div>Аннотация: </div><input onChange={e => SetAnnotation(e.target.value)}/>
            <div>id типа: </div><input onChange={e => SetType(e.target.value)}/>
            <div>цена: </div><input onChange={e => setCost(e.target.value)}/>
        </div>
        <button onClick={SaveService}>Отправить</button> 
    </form>
  );
};
export default CreateServices;
